class Recipes extends Component {


  render() {

    const RecipeList = this.props.recipeList.map((recipe, i) => {
      return (recipe);
      });

      return(
        <div>
        <div>
        {RecipeList}
        </div>
        </div>
      )
    }

  }

  export default Recipes;
